import React from "react";
import "./Card.css";
import "../../cards.json";

const Card = props => (
  <div className="card">
    <div className="img-container">
      <img alt="frog-image" src={props.image} />
    </div>

    <span onClick={() => props.handleBtnClick(props.id)}>
    </span>
  </div>
);

export default Card;
